import './App.css';
import {Route,Routes,BrowserRouter as Router} from 'react-router-dom';
import Login from './containers/Login';


function App() {
  return (
    <div className="App">
      <Router>
      <Routes>
        <Route path='/login' element={<Login/>}/>

      </Routes>
      </Router>
    </div>
  );
}

export default App;
